import contactWindow from './ContactWindow'
import messageWindow from "./MessageWindow";
import "../css/Layout.css"

export default function Layout(){
    return(
        <div>
            <navBar />
            <div className='layout-style'>
                <contactWindow />
                <messageWindow />
            </div>
        </div>
    );
}
